(37, 'Trà atisô túi lọc, 25 tép, hộp, mẫu quấn dây kraft', 0, '2021-10-18 11:18:14', '374D', 31, 0, 'https://appdala.net/wp-content/uploads/tra-atiso.webp', 'https://appdala.net/wp-content/uploads/atiso2.webp', '', 'Trà atisô túi lọc, 25 tép, hộp, mẫu quấn dây kraft\nDùng làm thức uống giải khát hàng ngày hoặc làm quà tặng.\nĐược chế biến từ nguyên liệu tự nhiên, hương vị thơm ngon.\nAn toàn vệ sinh, không chất bảo quản.\nĐóng gói dạng túi lọc tiện lợi.\nThuộc L’angfarm, thương hiệu đặc sản Đà Lạt hàng đầu.\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc.\nThông tin sản phẩm\nTên sản phẩm: Trà atisô túi lọc, 25 tép, hộp, mẫu quấn dây kraft\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã vạch: 8936003725225\nQuy cách thùng: 30 hộp\nKhối lượng tịnh / Thể tích thực: 50 g (25 túi lọc x 2 g)\nHạn sử dụng: 24 tháng\nThành phần: Atisô 92% (Thân và Lá 50%, Rễ 35%, Hoa 7%), Cỏ Ngọt 8%\nHướng dẫn bảo quản: Nơi khô ráo, thoáng mát. Tránh ánh nắng mặt trời chiếu trực tiếp\nHướng dẫn sử dụng: Nhúng trà vào tách nước sôi, 1 túi trà / 150 - 200 ml, chờ từ 3 - 5 phút. Dùng làm thức uống giải khát hàng ngày, mỗi ngày dùng từ 3 - 5 túi trà\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng sản phẩm khi phát hiện có hiện tượng mốc, mùi lạ\nSố: 51/QT/2019', 63000, NULL, NULL, NULL, 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 50),
(39, 'Kẹo hương dâu tây, 270g, hũ, mẫu tobita', 0, '2021-10-19 07:49:07', '39EU', 31, 0, 'https://appdala.net/wp-content/uploads/keodautay.webp', 'https://appdala.net/wp-content/uploads/keodautay-1.webp', '', 'Kẹo hương dâu tây, 270g, hũ, mẫu tobita\nĐặc sản Đà Lạt truyền thống\nChua chua ngọt ngọt, ăn là ghiền\nAn toàn vệ sinh, nguồn gốc rõ ràng\nBao bì tiết kiệm nhưng đẹp mắt, phù hợp tiêu dùng hoặc làm quà tặng\nĐược L\'angfarm kiểm soát chất lượng, đóng gói và phân phối\nSản phẩm chính hãng, giá chính gốc, ship toàn quốc\nThông tin sản phẩm\nTên sản phẩm: Kẹo hương dâu tây, 270g, hũ, mẫu tobita\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã vạch: 8936003729216\nKhối lượng tịnh / Thể tích thực: 270 g\nHạn sử dụng: 6 tháng\nThành phần: Bột Khoai (30%), Đường, chất điều chỉnh độ acid: Acid Citric, Hương Dâu Tổng Hợp,chất tạo màu tổng hợp: Ponceau 4R\nHướng dẫn bảo quản: Để nơi khô ráo, thoáng mát, tránh ánh nắng trực tiếp, đảm bảo vệ sinh\nHướng dẫn sử dụng: Dùng ngay sau khi mở bao bì, đậy kín sau mỗi lần sử dụng\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng sản phẩm khi có hiện tượng mốc, mùi vị lạ\nSản phẩm được sản xuất bởi: Cơ sở sản xuất kẹo Hạnh Tâm. Địa Chỉ: Số 23C, đường 3/4, phường 3, TP. Đà Lạt, tỉnh Lâm Đồng, Việt Nam\nSố: 01/QT/2018\nSản phẩm được đóng gói và kiểm soát chất lượng bởi L\'angfarm, một thương hiệu của công ty TNHH Quảng Thái.\n1B Hoàng Văn Thụ, P.5, TP. Đà Lạt, tỉnh Lâm Đồng, Việt Nam', 31000, NULL, NULL, NULL, 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 270),
(41, 'Thập cẩm sấy, dòng phổ thông, 450g, bịch, mẫu nhãn kẹp', 0, '2021-10-21 19:15:17', '41W', 31, 0, 'https://appdala.net/wp-content/uploads/thap-cam-say.webp', 'https://appdala.net/wp-content/uploads/thap-cam-say-1.webp;https://appdala.net/wp-content/uploads/thap-cam-say-2.webp', '', 'Thập cẩm sấy, dòng phổ thông, 450g, bịch, mẫu nhãn kẹp\nMón ăn vặt ưa thích, thích hợp tiêu dùng hoặc làm quà tặng.\nĐược chế biến từ trái cây tươi ngon. \nHương vị tự nhiên, giòn, ngon, hấp dẫn.\nAn toàn vệ sinh, không chất bảo quản.\nThuộc L’angfarm, thương hiệu đặc sản Đà Lạt hàng đầu.\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc.\nThông tin sản phẩm\nTên sản phẩm: Thập cẩm sấy, dòng phổ thông, 450g, bịch, mẫu nhãn kẹp\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã sản phẩm: 110110\nMã vạch: 8936003724532\nKhối lượng tịnh / Thể tích thực: 450 g\nHạn sử dụng: 3 tháng\nThành phần: 100% (Mít, Chuối, Khoai Môn, Khoai Lang Tím, Khoai Lang Vàng, Cà Rốt, Khổ Qua, Đậu Bắp, Đường Tinh Luyện, Dầu Cọ Tinh Luyện, Muối I-ốt)\nHướng dẫn bảo quản: Nơi khô ráo, thoáng mát. Tránh ánh nắng mặt trời trực tiếp\nHướng dẫn sử dụng: Sử dụng trong vòng 3 ngày sau khi mở gói. Cột kín miệng bịch khi không sử dụng\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng sản phẩm khi có hiện tượng nấm mốc, mùi vị lạ\nSản phẩm được sản xuất bởi: Hộ kinh doanh Thịnh Phát Đạt. Địa chỉ: Số 65, Đường 609, Tổ 2, Ấp Trung Viết, Xã Phước Hiệp, Huyện Củ Chi, TP. Hồ Chí Minh.', 85000, NULL, NULL, NULL, 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 450),
(43, 'Nấm linh chi đỏ Đà Lạt, 225g, bịch', 0, '2021-10-21 19:24:50', '43H', 31, 0, 'https://appdala.net/wp-content/uploads/Nam-linh-chi.webp', 'https://appdala.net/wp-content/uploads/nam-linh-chi-1.webp', '', 'Nấm linh chi đỏ Đà Lạt, 225g, bịch\nDùng làm thức uống giải khát hàng ngày hoặc làm quà tặng.\nĐược chế biến từ nguyên liệu linh chi đỏ Đà Lạt tuyển lựa.\nĐóng gói dạng bịch lớn tiết kiệm, thích hợp làm thức uống giải khát hàng ngày.\nHương vị thơm ngon, đảm bảo chất lượng, không chất bảo quản, an toàn tuyệt đối.\nThuộc L’angfarm, thương hiệu đặc sản Đà Lạt hàng đầu.\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc.\nThông tin sản phẩm\nTên sản phẩm: Nấm linh chi đỏ Đà Lạt, 225g, bịch\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã sản phẩm: 111023\nMã vạch: 8936003720541\nKhối lượng tịnh / Thể tích thực: 225 g\nHạn sử dụng: 12 tháng\nThành phần: Nấm linh chi đỏ 100%\nHướng dẫn bảo quản: Nơi khô ráo thoáng mát. Tránh ánh nắng mặt trời chiếu trực tiếp vào sản phẩm\nHướng dẫn sử dụng: Không rửa tai nấm, cắt tai nấm theo chiều ngang thành các lát nhỏ hoặc dùng nguyên tai:\n- Dùng nấu trực tiếp: Sử dụng khoảng 7g- 10g nấm trong 1.5- 2 lít nước, đun đến khi sôi, giảm nhỏ lửa tiếp tục đun khoảng 10-15 phút. Nấu lại 1 đến 2 lần để linh chi ra hết dược chất. Dùng làm nước uống hằng ngày.\n- Dùng ngâm rượu: Ngâm với rượu có nồng độ từ 38 độ trở lên, dùng 225g nấm ngâm trong 2.5- 3.5 lít rượu, sử dụng tốt nhất sau 4 tuần ngâm, pha loãng trước khi sử dụng.\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng sản phẩm khi phát hiện có hiện tượng mốc, mùi lạ\nSố: 69/QT/2019', 330000, NULL, NULL, NULL, 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 225),
(44, 'Nấm đông trùng hạ thảo sấy khô, 10g, hộp, mẫu quà tặng', 0, '2021-10-21 19:41:52', '44ZC', 31, 0, 'https://appdala.net/wp-content/uploads/dong-trung-1.webp', 'https://appdala.net/wp-content/uploads/dong-trung-2.webp', '', 'Nấm đông trùng hạ thảo sấy khô, 10g, hộp, mẫu quà tặng\nĐược chế biến từ nguyên liệu tự nhiên.\nNguồn gốc rõ ràng, an toàn vệ sinh.\nThuộc L’angfarm, thương hiệu đặc sản Đà Lạt hàng đầu.\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc.\nThông tin sản phẩm\nTên sản phẩm: Nấm đông trùng hạ thảo sấy khô, 10g, hộp, mẫu quà tặng\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã sản phẩm: 111075\nMã vạch: 8936003720534\nKhối lượng tịnh / Thể tích thực: 10 g\nHạn sử dụng: 12 Tháng\nThành phần: Nấm Đông Trùng Hạ Thảo 100%\nHướng dẫn bảo quản: Nơi khô ráo thoáng mát. Tránh ánh sáng, Đậy Kín Nắp Hộp Sau Mỗi Lần Dùng\nHướng dẫn sử dụng: Có thể dùng theo những cách sau đây:\n1.Dùng chế nước uống: Cho 5-10 cọng nấm đông trùng hạ thảo sấy khô vào bình trà, chế nước sôi, dùng uống như trà, khi uống hết nước có thể ăn luôn phần nấm đông trùng hạ thảo đã ngâm.\n2. Dùng ngâm rượu: Ngâm 10g nấm đông trùng hạ thảo sấy khô trong 2 lít rượu, ngâm trên 20 ngày là dùng được, mỗi ngày uống từ 30-50 ml\n3. Dùng ngâm mật ong: Ngâm 7g nấm đông trùng hạ thảo sấy khô trong 2 lít mật ong, ngâm từ 7- 10 ngày, mỗi ngày dùng 20-30 ml.\n4. Dùng chế biến các món bổ dưỡng: Nấm đông trùng hạ thảo sấy khô có thể nấu cùng trong món canh, súp: Hầm cùng gà, vịt, chim bồ câu, chim cút; Nấu cháo cùng thịt gà, thịt nạc...\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng sản phẩm khi có hiện tượng mốc, mùi lạ\nSố: 68/QT/2019', 370000, NULL, NULL, NULL, 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 10),
