(57, 'Hồng sấy treo Nhật Bản cắt lát, 225g, bịch, mẫu hút chân không', 0, '2021-10-25 21:46:52', '57T', 31, 0, 'https://appdala.net/wp-content/uploads/hong-say-treo-cat-lat.webp', 'https://appdala.net/wp-content/uploads/hong-say-lat.jpg', '', 'Hồng sấy treo Nhật Bản cắt lát, 225g, bịch, mẫu hút chân không\nCông nghệ sấy hồng treo được chuyển giao trực tiếp từ Nhật Bản.\nQuản đốc người Nhật trực tiếp phụ trách quản lý chế biến sản xuất.\nHồng Đà Lạt tuyển lựa.\nMón ăn vặt ưa thích, thích hợp tiêu dùng hoặc làm quà tặng.\nQuy trình sấy trải qua 14 ngày công phu, cho ra những trái hồng sấy treo ngon, ngọt, dẻo, màu sắc đẹp.\nAn toàn vệ sinh,.\nThuộc L’angfarm, thương hiệu đặc sản Đà Lạt hàng đầu.\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc.\nThông tin sản phẩm\nTên sản phẩm: Hồng sấy treo Nhật Bản cắt lát, 225g, bịch, mẫu hút chân không\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã sản phẩm: 111024\nMã vạch: 8936003724129\nKhối lượng tịnh / Thể tích thực: 225 g\nHạn sử dụng: 1 tháng\nThành phần: Trái hồng, chất bảo quản (E220)\nHướng dẫn bảo quản: Nơi khô ráo thoáng mát. Tránh ánh nắng mặt trời chiếu trực tiếp. Nhiệt độ bảo quản dưới 20oC.\nHướng dẫn sử dụng: Dùng ngay không qua chế biến\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng sản phẩm khi có hiện tượng nấm mốc, mùi lạ\nSố: 83/QT/2020', 165000, 160000, '2021-10-29 09:39:47', '2021-11-08 09:39:47', 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 225),
(60, 'Bưởi sấy dẻo, 225g, bịch, mẫu kraft 1 mặt trong', 0, '2021-10-25 22:05:34', '607B', 31, 0, 'https://appdala.net/wp-content/uploads/buoi-deo-2.jpg', 'https://appdala.net/wp-content/uploads/buoi-deo-1.jpg', '', 'Bưởi sấy dẻo, 225g, bịch, mẫu kraft 1 mặt trong\nDẻo ngọt tự nhiên, đậm vị từng miếng, tấm tắc thành tiếng\nNguyên liệu tuyển lựa, hương vị thơm ngon, bảo quản dễ dàng\nAn toàn vệ sinh, nguồn gốc rõ ràng\nBao bì handmade đẹp mắt, phù hợp tiêu dùng hoặc làm quà tặng\nCông nghệ sấy nhiệt độ thấp thoát hơi ẩm nhanh, giữ lại màu sắc, chất dinh dưỡng và vitamin\nSản phẩm chính hãng, giá chính gốc, ship toàn quốc\nThông tin sản phẩm\nTên sản phẩm: Bưởi sấy dẻo, 225g, bịch, mẫu kraft 1 mặt trong\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã sản phẩm: 110723\nMã vạch: 8936003728776\nKhối lượng tịnh / Thể tích thực: 225 g\nHạn sử dụng: 8 tháng\nThành phần: Vỏ bưởi 80%, đường 19.9%, chất bảo quản (E220)\nHướng dẫn bảo quản: Nơi khô ráo, thoáng mát. Tránh ánh nắng mặt trời trực tiếp\nHướng dẫn sử dụng: Dùng ngay không qua chế biến. Đậy kín hộp khi không sử dụng. Dùng trong vòng 7 ngày sau khi mở nắp\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng sản phẩm khi có hiện tượng nấm mốc, mùi vị lạ\nSản phẩm được sản xuất bởi: Chi nhánh công ty cổ phần công nghệ thực phẩm Lương Gia. Địa chỉ: Khu tiểu thủ công nghiệp Phú Thạnh- VĨnh Thanh, Xã Vĩnh Thanh, Huyện Nhơn Trạch, Đồng Nai.\nSố: 71/QT/2019', 80000, NULL, NULL, NULL, 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 225),
(61, 'Ngũ hạt thập cẩm, 135g, hũ, mẫu tobita', 0, '2021-10-25 22:18:49', '61R7', 31, 0, 'https://appdala.net/wp-content/uploads/ngu-hat-1.jpg', 'https://appdala.net/wp-content/uploads/ngu-hat-2.jpg', '', 'Ngũ hạt thập cẩm, 135g, hũ, mẫu tobita\nLựa chọn ăn vặt dinh dưỡng hàng đầu\nNguyên liệu tuyển lựa, hương vị đậm đà, ăn là ghiền\nAn toàn vệ sinh, nguồn gốc rõ ràng\nBao bì handmade đẹp mắt, phù hợp tiêu dùng hoặc làm quà tặng\nĐược L\'angfarm kiểm soát chất lượng, đóng gói và phân phối\nSản phẩm chính hãng, giá chính gốc, ship toàn quốc\nThông tin sản phẩm\nTên sản phẩm: Ngũ hạt thập cẩm, 135g, hũ, mẫu tobita\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã sản phẩm: 111269\nMã vạch: 8936003729124\nQuy cách thùng: 30 hũ\nKhối lượng tịnh / Thể tích thực: 135g\nHạn sử dụng: 9 tháng\nThành phần: Đậu phộng 40%, đậu hòa lan 22%, nui 11%, bột mì, bột bắp, đường, dầu thực vật, cốt dừa, muối iốt, bột wasabi, hành lá, chùm ngây, ớt, chất điều vị (621), hương dừa tổng hợp, phẩm màu tổng hợp (E110, E133)\nHướng dẫn bảo quản: Bảo quản nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp\nHướng dẫn sử dụng: Sử dụng ngay sau khi mở bao bì\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng sản phẩm khi có hiện tượng mốc, mùi vị lạ. Sản phẩm có chứa gói hút oxy\nSản phẩm được cung cấp bởi: Công ty TNHH SXCB và KD đặc sản Tinh Hoa Việt. Địa chỉ: Định An, xã Hiệp An, huyện Đức Trọng, tỉnh Lâm Đồng, Việt Nam\nSố: 14/QT/2020\nSản phẩm được kiểm soát chất lượng và phân phối bởi L\'angfarm, một thương hiệu của công ty TNHH Quảng Thái.\n1B Hoàng Văn Thụ, P.5, TP. Đà Lạt, tỉnh Lâm Đồng, Việt Nam', 40000, NULL, NULL, NULL, 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 135),
