(66, 'Trà Actisô - Túi 100 Túi Lọc x 2g', 0, '2021-10-26 10:52:14', '66S', 17, 0, 'https://appdala.net/wp-content/uploads/tui-loc-3-1.jpg', 'https://appdala.net/wp-content/uploads/tra-tui-loc-1-1.webp;https://appdala.net/wp-content/uploads/tui-loc-2.webp', '', 'Trà Actisô túi 100 túi lọc thượng hạng là sản phẩm truyền thống từ Actisô với hương thơm từ Actisô vớI vị ngọt hoàn toàn tự nhiên nay được bổ sung thêm thành phần cao Actisô giúp tăng cường hiệu quả phòng ngừa và bảo vệ gan mật.\nTúi 100 túi lọc giúp bạn tiết kiệm tối đa mà vẫn bảo vệ tốt sức khỏe hàng ngày.\nGiúp mát gan,thông mật, lợi tiểu. Dùng tốt trong những trường hợp: Yếu gan,nổi mể đay, vàng da.\nThành phần:\nActisô……………………………….1,65 g\nCao Actisô tinh chế …………0,04 g\nPhụ liệu: Cỏ ngọt …………….0,31 g\nQuy cách đóng gói:\nGói 2g. túi 100 gói.\nChỉ định:\nMát gan,thông mật, lợi tiểu\nDùng tốt trong những trường hợp: Yếu gan,nổi mể đay, vàng da.\nDùng được cho người bị tiểu đường.\nCách dùng và liều dùng:\nNhúng túi trà vào ly nước sôi\nChờ 3- 5 phút\nCó thể cho thêm đường tuỳ ý.\nSản phẩm này không phải là thuốc, không có tác dụng thay thế thuốc chữa bệnh.', 95000, 55000, '2021-10-30 20:09:24', '2021-11-09 20:09:24', 0, 0, 3, 1, 1, 1, '', '', '', NULL, NULL, NULL, 200),
(67, 'Cao Ống Actiso (Không Đường) - Hộp 10 ống x 10ml', 0, '2021-10-26 14:00:06', '67EL', 17, 0, 'https://appdala.net/wp-content/uploads/cao-ong-5.jpg', 'https://appdala.net/wp-content/uploads/cao-atiso-ong1.webp;https://appdala.net/wp-content/uploads/cao-atiso-ong-3.webp;https://appdala.net/wp-content/uploads/cao-atiso-ong.webp', '', 'LADOACTISO Cao Ống (không đường) là sản phẩm cao Actisô dạng nước, giữ nguyên những đặc tính quý giá vốn có của cây Actisô tươi, góp phần bảo vệ sức khỏe cho bạn và người thân trước những tác nhân độc hại của môi trường và đặc biệt tác hại do dùng nhiều bia rượu.\n\nĐặc biệt, sản phẩm không có đường kính để tạo ngọt. Thích hợp cho người bị tiểu đường và đang ăn kiêng. Actiso bản chất có vị đắng, để điều vị Ladophar sử dụng công thức đặc biệt có thêm 300mg cao thân rễ trong thành phần. Đồng thời thêm dược liệu Cỏ ngọt tạo vị thanh mát giúp bạn dễ uống hơn. \n\nSản phẩm được đóng gói trong ống nhựa nhỏ gọn, tiện lợi và dễ sử dụng. Dễ dàng mang theo khi làm việc, tiệc tùng, hội hè và du lịch. Sẵn sàng bảo vệ sức khỏe mọi lúc mọi nơi.\nThành phần: Mỗi ống 10ml có chứa\nCao đặc thân, rễ Actiso………....300mg \nCao đặc lá Actiso ………..………...200mg \nPhụ liệu: Cỏ ngọt, nước...........vừa đủ 10ml\nCông dụng:\nGiúp mát gan, lợi mật, hỗ trợ tăng cường chức năng gan, giúp cải thiện quá trình tiêu hóa do chức năng gan kém\nĐối tượng sử dụng:\n-Người bị suy gan, xơ gan, men gan tăng, viêm gan\n-Người ăn uống kém tiêu, chán ăn, vàng da, mệt mỏi do chức năng gan kém.\n-Người uống bia rượu nhiều, tiếp xúc hoặc sử dụng hóa chất có hại cho gan.\nCách dùng:\n-Trẻ en > 2 tuổi: 1/2 - 1 ống/lần x 2 lần/1 ngày\n-Người lớn: 1-2 ống/lần x 2 lần/ngày\n-Có thể dùng trực tiếp hoặc pha với nước lọc\nBảo quản: \nNơi khô ráo, nhiệt độ dưới 30oC, tránh ánh sáng trực tiếp\nKhông sử dụng cho người mẫn cảm với bất kỳ thành phần nào có trong sản phẩm\nThực phẩm này không phải là thuốc, không có tác dụng thay thế thuốc chữa bệnh.', 69000, NULL, NULL, NULL, 0, 0, 3, 2, 1, 1, '', '', '', NULL, NULL, NULL, 100),
