(98, 'Trà đông trùng hạ thảo túi lọc, 25 tép, hộp, mẫu quấn dây đen', 0, '2021-10-29 11:55:40', '98KWM', 31, 0, 'https://appdala.net/wp-content/uploads/tra-tui-loc-dong-trung-ha-thao-25-tep.jpg', '', '', 'Trà đông trùng hạ thảo túi lọc, 25 tép, hộp, mẫu quấn dây đen\nDùng làm thức uống giải khát hàng ngày hoặc làm quà tặng.\nĐược chế biến từ nguyên liệu tự nhiên, hương vị thơm ngon.\nAn toàn vệ sinh, không chất bảo quản.\nĐóng gói dạng túi lọc tiện lợi.\nThuộc L’angfarm, thương hiệu đặc sản Đà Lạt hàng đầu.\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc.\nThông tin sản phẩm\nTên sản phẩm: Trà đông trùng hạ thảo túi lọc, 25 tép, hộp, mẫu quấn dây đen\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã sản phẩm: 111160\nMã vạch: 8936003725218\nQuy cách thùng: 30 hộp\nKhối lượng tịnh / Thể tích thực: 50 g (25 túi lọc x 2 g)\nHạn sử dụng: 24 tháng\nThành phần: \nHướng dẫn bảo quản: Nơi khô ráo, thoáng mát. Tránh ánh nắng mặt trời chiếu trực tiếp\nHướng dẫn sử dụng: Nhúng trà vào tách nước sôi, 1 túi trà / 150 - 200 ml, chờ từ 3 - 5 phút. Dùng làm thức uống giải khát hàng ngày\nSố CB: ', 330000, NULL, NULL, NULL, 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 50),
(99, 'Bánh biscotti nông sản Đà Lạt, 280g, hộp, mẫu ichiba', 0, '2021-10-29 12:00:49', '99CN', 31, 0, 'https://appdala.net/wp-content/uploads/banh-biscotti-nong-san-280g-hop-1.webp', 'https://appdala.net/wp-content/uploads/banh-biscotti-nong-san-280g-hop-2.webp;https://appdala.net/wp-content/uploads/banh-biscotti-nong-san-280g-hop-3.webp', '', 'Bánh biscotti nông sản Đà Lạt, 280g, hộp, mẫu ichiba\nBánh to gấp đôi, hạt nhiều gấp ba, 1 bánh cho 1 bữa\nBánh ngon với 4 vị nông sản độc đáo\nAn toàn vệ sinh, nguồn gốc rõ ràng\nHộp giấy handmade đẹp mắt, thích hợp tiêu dùng hoặc làm quà tặng\nBánh handmade do L\'angfarm trực tiếp phát triển và sản xuất\nSản phẩm chính hãng, giá chính gốc, ship toàn quốc\nThông tin sản phẩm\nTên sản phẩm: Bánh biscotti nông sản Đà Lạt, 280g, hộp, mẫu ichiba\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã sản phẩm: 1000947\nMã vạch: 8936003723429\nKhối lượng tịnh / Thể tích thực: 280g\nHạn sử dụng: 3 tháng\nThành phần: Bột mì 35.2%; Hạt dinh dưỡng 26.82% (Hạt hạnh nhân, hạt óc chó, hạt điều, hạt chia, hạt mè đen, hạt bí xanh); Trứng gà 20.98%; Bơ 9.82%; Chocolate; Xơ: Sanacel wheat; Chất bảo quản: INO AP 66; Bột trà xanh\nHướng dẫn bảo quản: Bảo quản nơi khô ráo, thoáng mát, tránh xa ánh nắng trực tiếp\nHướng dẫn sử dụng: Thực phẩm ăn liền không qua chế biến. Sử dụng ngay sau khi mở bao bì.\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng khi có hiện tượng mốc, mùi vị lạ. Sản phẩm có chứa túi hút oxy\nChất gây dị ứng: Sản phẩm không phù hợp cho những người bị dị ứng với các thành phần đã nêu trên\nSố: 114/QT/2021', 110000, NULL, NULL, NULL, 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 280),
