(157, 'Hạt macca, 250g, bịch, mẫu kraft 1 mặt trong', 0, '2021-10-29 23:40:06', '157TO', 31, 0, 'https://appdala.net/wp-content/uploads/hat-macca-tui-kraft-250g-1.jpg', '', '', 'Hạt macca, 250g, bịch, mẫu kraft 1 mặt trong\nHạt macca được mệnh danh là hoàng hậu của các loại hạt, dinh dưỡng ngập tràn, tăng cường sức khoẻ tim mạch, đường ruột, não bộ, bổ sung chất chống oxy hoá, chống ung thư, tăng tuổi thọ\nNguyên liệu macca Lâm Đồng, thơm thơm béo béo, ăn hoài không ngán\nAn toàn vệ sinh, nguồn gốc rõ ràng\nBao bì handmade đẹp mắt, phù hợp tiêu dùng hoặc làm quà tặng\nĐược L\'angfarm kiểm soát chất lượng, đóng gói và phân phối\nSản phẩm chính hãng, giá chính gốc, ship toàn quốc\nThông tin sản phẩm\nTên sản phẩm: Hạt macca, 250g, bịch, mẫu kraft 1 mặt trong\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã sản phẩm: 110989\nMã vạch: 8936003728905\nQuy cách thùng: 30 hũ\nKhối lượng tịnh / Thể tích thực: 250 g\nHạn sử dụng: 6 tháng\nThành phần: Hạt macca 100%\nHướng dẫn bảo quản: Nơi khô ráo, thoáng mát. Tránh ánh nắng mặt trời chiếu trực tiếp\nHướng dẫn sử dụng: Ăn ngay sau khi mở bao bì\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng sản phẩm khi có hiện tượng nấm mốc, mùi vị lạ. Sản phẩm có chứa gói hút oxy.\nSản phẩm được sản xuất bởi: Công ty TNHH Mắc Ca Việt. Địa chỉ: 50 thôn 3, xã Trung Hòa, huyện Di Linh, tỉnh Lâm Đồng, Việt Nam\nSố: 40/QT/2019\nSản phẩm được đóng gói và kiểm soát chất lượng bởi L\'angfarm, một thương hiệu của công ty TNHH Quảng Thái.\n1B Hoàng Văn Thụ, P.5, TP. Đà Lạt, tỉnh Lâm Đồng, Việt Nam', 120000, NULL, NULL, NULL, 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 250),
