(170, 'Nấm đông cô sấy khô, 150g, bịch', 0, '2021-10-30 00:37:42', '1707D', 31, 0, 'https://appdala.net/wp-content/uploads/nam-dong-co-say-kho-tui-150g.jpg', 'https://appdala.net/wp-content/uploads/nam-dong-co-say-kho-tui-150g-2.jpg', '', 'Nấm đông cô sấy khô, 150g, bịch\nDùng làm thức uống hàng ngày hoặc làm quà tặng.\nĐược chế biến từ nguyên liệu tự nhiên.\nNguồn gốc rõ ràng, an toàn vệ sinh.\nThuộc L’angfarm, thương hiệu đặc sản Đà Lạt hàng đầu.\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc.\nThông tin sản phẩm\nTên sản phẩm: Nấm đông cô sấy khô, 150g, bịch\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã sản phẩm: 111058\nMã vạch: 8936003720510\nKhối lượng tịnh / Thể tích thực: 150 g\nHạn sử dụng: 12 tháng\nThành phần: Nấm đông cô (100%)\nHướng dẫn bảo quản: Bảo quản kín khí tại nơi khô ráo, thoáng mát, vệ sinh, tránh ánh nắng mặt trời trực tiếp\nHướng dẫn sử dụng:\n- Cách sơ chế: Ngâm nấm ngập trong nước lạnh trong 8 giờ hoặc để qua đêm cho nở mềm. Xả nấm nhiều lần và vắt nhẹ tai nấm bằng tay sau mỗi lần xả nước. Phần nước ngâm nấm có thể chắt cặn, giữ lại để sử dụng trong quá trình nấu ăn\n- Cách chế biến món canh: Cắt lát và dùng nấm trong chế biến các món ăn như kho, xào, hầm, nấu canh,... Để đảm bảo chất dinh dưỡng không bị thất thoát và hình dạng nấm, không nên nấu quá lâu, nấu sôi từ 5 - 10 phút\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng sản phẩm khi phát hiện có hiện tượng mốc, mùi lạ\nSố CB: 88/QT/2020', 241000, NULL, NULL, NULL, 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 150),
(171, 'Bông atisô sấy khô, 225g, bịch', 0, '2021-10-30 00:40:51', '171OQ', 31, 0, 'https://appdala.net/wp-content/uploads/bong-atiso-say-kho-tui-225g-1.webp', 'https://appdala.net/wp-content/uploads/bong-atiso-say-kho-tui-225g-2.webp;https://appdala.net/wp-content/uploads/bong-atiso-say-kho-tui-225g-3.jpg', '', 'Bông atisô sấy khô, 225g, bịch\nDùng làm thức uống giải khát hàng ngày hoặc làm quà tặng.\nĐược chế biến từ nguyên liệu tự nhiên.\nNguồn gốc rõ ràng, an toàn vệ sinh.\nThuộc L’angfarm, thương hiệu đặc sản Đà Lạt hàng đầu.\nMua hàng online, sản phẩm chính hãng, giao hàng toàn quốc.\nThông tin sản phẩm\nTên sản phẩm: Bông atisô sấy khô, 225g, bịch\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã sản phẩm: 110077\nMã vạch: 8936003720527\nKhối lượng tịnh / Thể tích thực: 225 g\nHạn sử dụng: 12 tháng\nThành phần: Bông Atisô 100%\nHướng dẫn bảo quản: Nơi khô ráo thoáng mát. Tránh ánh nắng mặt trời chiếu trực tiếp vào sản phẩm\nHướng dẫn sử dụng:\n1. Dùng chế nước uống: Cho 20-30 g, chế trong 1-1.5 lít nước, dùng làm thức uống giải khát hàng ngày. Có thể chế theo 2 cách:\n- Nấu trực tiếp: Tráng rửa sạch, châm nước, đun sôi 5-10 phút, có thể uống nóng hoặc lạnh\n- Hãm bằng nước sôi: Tráng nước sôi, hãm bằng bình pha trà với nước sôi từ 5-7 phút, có thể hãm 1-2 lần. Hoặc có thể dùng bình giữ nhiệt hãm 1 lần\n2. Dùng chế biến món canh: Tráng rửa sạch, hầm chung xương, giò heo,...\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng sản phẩm khi phát hiện có hiện tượng mốc, mùi lạ\nSố: 44/QT/2019', 186000, NULL, NULL, NULL, 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 225),
