(176, 'Cao atisô, 150g, hộp, mẫu hũ thuỷ tinh', 0, '2021-10-30 00:59:39', '176PR', 31, 0, 'https://appdala.net/wp-content/uploads/cao-atiso-hop-thuy-tinh-150g-1.webp', '', '', 'Cao atisô, 150g, hộp, mẫu hũ thuỷ tinh\nAtisô giúp mát gan, người khoẻ, da dẻ mịn màng\nTốt cho người gan yếu, uống rượu bia nhiều, ăn uống khó tiêu, táo bón, máu nhiễm mỡ\nNguyên chất chiết xuất từ lá tươi cây atisô\nAn toàn vệ sinh, nguồn gốc rõ ràng\nBao bì handmade đẹp mắt, thích hợp tiêu dùng hoặc làm quà tặng\nSản phẩm chính hãng, giá chính gốc, ship toàn quốc\nThông tin sản phẩm\nTên sản phẩm: Cao atisô, 150g, hộp, mẫu hũ thuỷ tinh\nThương hiệu: L\'angfarm - Đặc Sản Đà Lạt\nMã sản phẩm: 111027\nMã vạch: 8936003720794\nKhối lượng tịnh / Thể tích thực: 150 g\nHạn sử dụng: 12 tháng\nThành phần: Lá Atisô 100%\nHướng dẫn bảo quản: Nơi khô ráo thoáng mát. Tránh ánh nắng mặt trời chiếu trực tiếp vào sản phẩm\nHướng dẫn sử dụng:\nPha 2 g cao atisô với nước ấm cho 1 lần uống. Tốt nhất uống giữa 2 bữa ăn hoặc cách bữa ăn 30 phút. Sử dụng 2 - 3 lần mỗi ngày. Có thể thêm đường hoặc mật ong để làm tăng thêm hương vị\nThông tin cảnh báo an toàn, vệ sinh: Không sử dụng sản phẩm khi phát hiện có hiện tượng mốc, mùi lạ\nSản phẩm được sản xuất bởi: Công Ty TNHH Dược Liệu Hữu Cơ Việt Nam. Địa chỉ: Liền kề 19-1, Khu Đô Thị Mới Văn Khê, P. La Khê, Q. Hà Đông, TP. Hà Nội\nSố: 118/QT/2020', 142000, NULL, NULL, NULL, 0, 0, 10, 1, 1, 1, '', '', '', NULL, NULL, NULL, 150);
